B.IS=new A.aH(B.he,[u.q,"DigiBot adalah chatbot yang terintegrasi langsung dengan database aplikasi DigiTeam, yang dirancang untuk memudahkan pengguna dalam mencari dan mengolah data terkait aktivitas mereka, seperti logbook, absensi, cuti, dan lainnya. Dengan kemampuan ini, pengguna dapat berinteraksi dengan chatbot untuk mendapatkan informasi secara instan tanpa perlu mencari secara manual. DigiBot juga membantu pengguna yang belum familiar dengan fitur baru aplikasi atau kesulitan dalam menggunakan aplikasi, memberikan panduan atau menjawab pertanyaan terkait penggunaan fitur aplikasi. \n\nChatbot ini dikembangkan dengan menggunakan kombinasi model FFNN dan IndoBERT. Proses pengembangan dimulai dari training model dengan dataset percakapan untuk memahami dan merespons input dalam bahasa Indonesia, Sunda, dan Inggris. Setelah model selesai dilatih, chatbot diintegrasikan menggunakan Flask sebagai backend untuk menghubungkan model AI dengan aplikasi mobile DigiTeam. Ini juga menangani komunikasi antara aplikasi dan database, seperti menyimpan riwayat percakapan di Firebase Firestore. Untuk melihat artikel dan kode pengembangan chatbot, Anda dapat mengakses link di bawah ini",u.c],t.l)
